import { useState } from 'react';
import "./Dashboard.css";
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import FloatingLabel from 'react-bootstrap/FloatingLabel';
import Form from 'react-bootstrap/Form';

function Example() {
    const [show, setShow] = useState(false);
    const [count, setCount] = useState(0);
    const [todos, setTodos] = useState([]);
    const [email, setEmail] = useState("");
    const [name, setName] = useState("");
    const [id, setId] = useState("");



    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    const handleClickPlus = () => {
        setCount(count + 1);
    }
    const handleClickMinus = () => {
        setCount(count - 1);
    }

    useEffect(() => {

        getUsers();

    }, []);

    const getUsers = () => {
        axios.get('http://localhost:5001/users')
            .then((res) => {
                // console.log(res);
                setTodos(res.data.data);
            })

    }

    const handleCustomer = (e) => {
        e.preventDefault();

        if (id) {
            axios.put("http://localhost:5001/users", { id, name, email })
                .then((response) => {
                    setName("");
                    setEmail("");
                    setId("");
                    getUsers("");


                })


        } else {
            axios.post("http://localhost:5001/users", { id, name, email })
                .then((response) => {
                    setName("");
                    setEmail("");
                    setId("");
                    getUsers("");
                    clearForm("");

                })

        }
    }
    const clearForm = () => {
        setName("");
        setEmail("");
        setId("");
    }

    const handleDelete = async (userId) => {
        try {
            const response = await axios.delete('http://localhost:5001/users', { data: { id: userId } })
            console.log(response.data.data);
            getUsers();
        } catch (error) {
            console.error("There was an error deleting the user!", error);
        }
    };

    const userform = (userData) => {
        setName(userData.name);
        setEmail(userData.email);
        setId(userData.id);
    }
    return (
        <>
            <Button variant="primary" className='btn-1' onClick={handleShow}>
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-search" viewBox="0 0 16 16">
                    <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001q.044.06.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1 1 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0" />
                </svg>
            </Button>

            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Modal heading</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <FloatingLabel
                        controlId="floatingInput"
                        label="Name"
                        className="mb-3"
                    >
                        <Form.Control type="email" placeholder="name@example.com" />
                    </FloatingLabel>
                    <FloatingLabel controlId="floatingPassword" label="Product Name">
                        <Form.Control type="password" placeholder="Password" />
                    </FloatingLabel>
                </Modal.Body>
                <div className='btn-o'>
                    <h4 className='me-3'>Item</h4>
                    <Button variant="primary" onClick={handleClickMinus}>-</Button>{' '}
                    <h3 className='btn-2'>
                        {count}
                    </h3>
                    <Button variant="primary" onClick={handleClickPlus}>+</Button>{' '}
                </div>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleClose}>
                        Close
                    </Button>
                    <Button variant="primary" onClick={handleClose}>
                        Save Changes
                    </Button>
                </Modal.Footer>
            </Modal>

            <h2 className='ms-5'>To Do List</h2>
            <form onSubmit={handleCustomer}>
                <input type='text' placeholder='Username' className='gap-1' value={name} onChange={(e) => setName(e.target.value)} />
                <input type='text' placeholder='Email' className='gap-1' value={email} onChange={(e) => setEmail(e.target.value)} />
                <Button variant="success" type='submit' className='ms-3'>{id ? 'Update' : 'Add'}</Button>
            </form>

            <ul className='mt-3'>
                {todos.map(data => (
                    <li key={data.id} className='db'>
                        ID: {data.id} | NAME:{data.name} | EMAIL:{data.email}
                        <Button variant="primary" onClick={() => userform(data)} className='mt-2 me-2'>Edit</Button>
                        <Button variant="danger" onClick={() => handleDelete(data.id)} className='mt-2'>Delete</Button>
                    </li>

                ))}
            </ul>
        </>
    );
}

export default Example;
